import house from "../imgs/househelp1.png";
import logo from "../imgs/house.png";
import reactDom from "react-dom";
import Login from "./Login";
import "./home.css";
import Signup from "./Signup";
import downarrow from "../imgs/down-arrow.png"
function Home() {


    return (
      <div className="Home" style={{width:"100%", marginTop:"0PX"}}>

          <div id="container" >
                <h1>Welcome  New User !</h1>
              <button id="btn1" onClick={renderSignup}>Register As a Househelp & <br></br><span>
                Start Earning</span></button>
                {/* <hr style={{width: "65%", marginLeft: "auto" , marginRight: "auto" ,marginBottom:"5%",color:"eee"}}></hr> */}
                <p style={{fontsize: "1.5em"}}>Or</p>
                <button id="btn2" onClick={renderLogin}>Login</button>
               {/* <hr style={{width: "65%", marginLeft: "auto", marginRight: "auto",marginBottom:"5%" }}></hr> */}
               <p style={{fontSize: "1em" ,margin :"5%"}}>Click to Order Househelp </p>
               <p style={{textalign: "center"}}><img src={downarrow} style={{width: "30px", height: "auto"}} ></img> </p>

               <a href="../request"> <button id="btn3">Order Househelp Now</button></a>



            </div>




     </div>
    );
  }

  function renderSignup(){
    reactDom.render(
      <Signup />,document.querySelector("#container")
    )
  }
  function renderLogin(){
    reactDom.render(
      <Login />,document.querySelector("#container")
    )
  }
  export default Home;
